import { BrowserRouter, Router } from "react-router-dom";
import Nav from "./components/Nav";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
      </BrowserRouter>

      <h1>hello Sir</h1>
    </div>
  );
}

export default App;
